(lib.mcOpppp = function(mode,startPosition,loop,reversed) {
if (loop == null) { loop = true; }
if (reversed == null) { reversed = false; }
	var props = new Object();
	props.mode = mode;
	props.startPosition = startPosition;
	props.labels = {};
	props.loop = loop;
	props.reversed = reversed;
	cjs.MovieClip.apply(this,[props]);

	// Layer_3 (mask)
	var mask = new cjs.Shape();
	mask._off = true;
	mask.graphics.p("AqpPVIAA+pIVTAAIAAepg");
	mask.setTransform(151.2,219.05);

	// Layer_1
	this.instance = new lib._2Opppp();
	this.instance.setTransform(168.05,78.1,1,1,0,0,0,20,150.1);

	var maskedShapeInstanceList = [this.instance];

	for(var shapedInstanceItr = 0; shapedInstanceItr < maskedShapeInstanceList.length; shapedInstanceItr++) {
		maskedShapeInstanceList[shapedInstanceItr].mask = mask;
	}

	this.timeline.addTween(cjs.Tween.get(this.instance).to({y:187.1},69).wait(1));

	this._renderFirstFrame();

}).prototype = p = new cjs.MovieClip();
